  b 06.10.1939
  b 25.08.1947
  Malcolm b. at Waipawa and m, at the First Presbyterian Church, Papakura. Anne, d/o
  Harold Ashford and Hilda McPherson, b, at Eltham. Address: 23 Kauri Road, Whenuapai,
  Auckland,
  Malcolm was educated at Elsthorpe, Glen Murray and Wesley College, Paerata. He joined
  the RNZAF as a cadet in 1956, qualifying as an aero engineer in 1958. He saw active
  service with No 75 Squadron in Malaya during 1959/60. In 1966 he completed Wasp
  helicopter and Royal Navy Navigator courses in the United Kingdom and became the first aircrewman
  afloat on the HMNZS Waikato on her maiden voyage to New Zealand in 1967. From 1968 he was a member of
  No 3 Helicopter Squadron at Hobsonville and spent several years on mercy missions and military
  exercises in the South Pacific Islands. He retired in 1979 as F/Sgt in charge of Sioux and Iroquois
  helicopter servicing. Malcolm now works for a Toyota cars agency in Kumeu. He has been an executive
  committee member of the Hobsonville RSA since 1982. His leisure pursuits include boating and fishing.
  Anne was a member of the WRNZAF from 1965 to 1967. She has been an administrator at the University of
  Auckland since 1984. Her interests include botany and geology and she is a keen supporter of the Royal
  Forest and Bird Protection Society.
